const HomePage = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "red",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ flex: 2 }}>TOp</div>
      <div style={{ flex: 8, background: "gray" }}>Bottom</div>
    </div>
  );
};

export default HomePage;
